import "./ExpenseItem.css";

function ExpenseItemTable(props) {

  return (
    <div className="expense-item">
      <table width="100%">
        <td>{props.date.toISOString()}</td>
        <td className="expense-Item__description">
          <h2>{props.title}</h2>
        </td>
        <td className="expense-item__price">${props.amount}</td>
      </table>
    </div>
  );
}

export default ExpenseItemTable;
